import React from 'react';

import logo from './logo.svg';
import './App.css';
import DinnerModel from './dinnerstuff/DinnerModel';
import SidebarView from './sidebar/sidebarView';
const model= new DinnerModel();
const sidebar = new SidebarView(model);

function App() {
  return (

    <div className="App">
    <div></div>
    <div class="sidebar">{sidebar.render()}</div>

    </div>
  );
}


export default App;
